import React from 'react';
import {Link} from 'react-router-dom'


const NotFound = () => {
    return (
        <>
                <h1>Page was not found</h1>
                <Link to='/'>Home</Link>
            <img src='./notFound.jpeg' alt={'sorry'}/>

        </>
    );
}

export default NotFound
